import * as React from 'react';
import {AppBar} from "@mui/material";



function NavBar() {
  

  return (
    <div id='navContainer'>
<AppBar sx={{
  
    zIndex: "11",
    backgroundColor:"white",
    width:"85%",
    height:"3vw",
    borderRadius:"15px",
   }} id = "navbar"></AppBar>
    </div>
   
  );
}
export default NavBar;
